  `Fecha_Ult_Con` datetime DEFAULT NULL,
  `foto_archivo` blob DEFAULT NULL,
  PRIMARY KEY (`Id_Us`),
  UNIQUE KEY `idx_usu_correo` (`Correo`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

